;; **
;;; ## Vietnam
;; **

;; @@
(def vietnam (read-csv-with-header "imo/vietnam.csv"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-firefly/vietnam</span>","value":"#'radioactive-firefly/vietnam"}
;; <=

;; **
;;; ### Top Schools
;; **

;; **
;;; 
;; **

;; @@
(let [top-schools (->> (group-by :school vietnam)
                	   (map (fn [[k v]] [k (count v)]))
	                   (sort-by (comp - last))
                       (take 10))]
  
  (clojure.pprint/print-table (map #(zipmap ["school" "no"] %) top-schools))
  
  (gg4clj/view [[:<- :g (gg4clj/data-frame {:school (map first top-schools)
			                                :no     (map second top-schools)})]
                (gg4clj/r+
                  [:ggplot :g [:aes {:x :school, :y :no, :fill :school}]]
                  [:geom_col {:width 0.9}]
                  [:coord_polar {:theta "y"}]
                  [:theme {:axis.text [:element_blank]
                           :axis.ticks [:element_blank]}]
                  [:scale_fill_brewer {:palette "Set3"}]
                  [:labs {:title "Top School"
                          :fill "School"
                          :x :NULL, :y :NULL}])]))
